INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('8410300358237', 'Гороховый крем-суп «По-голландски»', 'Сухарики хрустящие (мука _пшеничная_, вода, дрожжи хлебопекарные, соль поваренная); Загустители (дикрахмалфосфат оксипропилированный, крахмал ацетилированный); Картофельные хлопья (картофель, антиокислители (_пиросульфит_ натрия, аскорбилпальмитат, аскорбиновая кислота), эмульгаторы (моно- и диглицериды жирных кислот, пирофосфат натрия), натуральный краситель куркумин); Жир растительный (глюкозный сироп, _молочный_ белок, кокосовое масло, стабилизаторы (орто-фосфат калия 2-замещенный, полифосфат натрия), эмульгаторы (моно- и диглицериды жирных киспот, эфиры глицерина, лимонной и жирных кислот), антислеживающий arент диоксид кремния аморфный); Соль; Ароматизаторы: бекона (соль, глюкоза, мука _пшеничная_, лук, паприка, сахар, чеснок, вкусоароматические вещества, дрожжевой экстракт, жир растительный), желтого ropoxа (мальтодекстрин, раститеьное маспо, вкусоароматические вещества), зеленого rороха, томата с зеленью, говядины (содержит _лактозу_) содержат натуральные красители (сахарный колер III, экстракт паприки), рerуляторы кислотности (пимонная янтарная кислоты, ацетат натрия), антислеживающий агент диоксид кремния аморфный, стабилизатор гуммиарабик; Овощи (морковь, петрушка, укроп, лук); Подсолнечное масло; Сахар; Экстракт дрожжей (содержит _глютен_), Пряности и специи (куркума, лaвровый лист, _сельдерей_); Натуральные красители (сахарный колеp IV, бета-каротин); Гороховая мyка; Toматный порошок.', 'https://static.openfoodfacts.org/images/products/841/030/035/8237/front_ru.7.400.jpg', '11', '', '54', '', '', '6', '', '', '', '1');

